import { DataInput } from "./FormStyles";

interface Props {
  labelName: string;
  rows: number;
};

const MessageInput: React.FC<Props> = (props) => {
  return(
    <DataInput placeholder={props.labelName} rows={props.rows}/>
  )
};

export default FormMessage;
